  drawRectangle(x, y + 4, white, 4, 1);
  drawRectangle(x + 3, y + 2, white, 1, 6);
  drawRectangle(x, y + 8, white, 4, 2);
}

function drawNine(x, y) {
  drawRectangle(x + 4, y, white, 2, 10);
  drawRectangle(x + 2, y, white, 2, 1);
  drawRectangle(x + 2, y + 3, white, 2, 1);
  drawRectangle(x, y, white, 2, 4);
}

const numbers = [
  drawZero,
  drawOne,
  drawTwo,
  drawThree,
  drawFour,
  drawFive,
  drawSix,
  drawSeven,
  drawEight,
  drawNine,
];

// classes

class Player {
  constructor(x, y) {
    this.xPos = x;
    this.yPos = y;
    this.xVel = 0;
    this.yVel = 0;
    this.size = 4;
    this.color = orange;
    this.health = 3;
    this.diedAt = null;
    this.lastFired = 0;
  }

  shoot() {
    bullets.push(new Bullet(this.xPos + 1, this.yPos - 1));
    shotsFired++;
    this.lastFired = frame;
  }

  update() {
    if (frame % 2 != 0) {
      return;
    }

    let nextX = this.xPos + this.xVel;

    // wall collision detection

    if (nextX >= 0 && nextX <= 63 - this.size + 1) {
      this.xPos += this.xVel;
    }
  }

  draw() {
    if (this.health == 3) {
      drawBlock(this.xPos, this.yPos, this.color, this.size);
      drawRectangle(this.xPos - 2, this.yPos + 3, this.color, 2, 1);
      drawPixel(this.xPos - 2, this.yPos + 2, this.color);
      drawRectangle(this.xPos + this.size, this.yPos + 3, this.color, 2, 1);
      drawPixel(this.xPos + this.size + 1, this.yPos + 2, this.color);
    } else if (this.health == 2) {
      for (let i = 0; i < this.size; i++) {
        drawPixel(this.xPos + i, this.yPos, this.color);
        drawPixel(this.xPos + i, this.yPos + this.size - 1, this.color);
        if (i >= 1 && i < this.size - 1) {
          drawPixel(this.xPos, this.yPos + i, this.color);
          drawPixel(this.xPos + this.size - 1, this.yPos + i, this.color);
        }
      }
    } else if (this.health == 1) {
      for (let i = 1; i < this.size - 1; i++) {
        drawPixel(this.xPos + i, this.yPos, this.color);
        drawPixel(this.xPos + i, this.yPos + this.size - 1, this.color);
        drawPixel(this.xPos, this.yPos + i, this.color);
        drawPixel(this.xPos + this.size - 1, this.yPos + i, this.color);
      }
    }
  }
}

class Bullet {
  constructor(x, y) {
    this.xPos = x;
    this.yPos = y;
    this.size = 2;
    this.yVel = -2;
    this.timeBorn = frame;
    this.active = true;
  }

  update() {
    this.yPos += this.yVel;

    if (this.yPos < 0 - this.size) {
      this.active = false;
    }

    // detect collision with asteroid

    if (asteroids) {
      for (let i = 0; i < asteroids.length; i++) {
        let nextY = this.yPos + this.yVel;
        let asteroid = asteroids[i];
        const inBoundsY =
          nextY >= asteroid.yPos - 1 &&
          nextY <= asteroid.yPos + asteroid.height - 1;
        const inBoundsX =
          this.xPos >= asteroid.xPos - 1 &&
          this.xPos < asteroid.xPos + asteroid.width;

        if (inBoundsY && inBoundsX) {
          this.active = false;
          asteroid.active = false;
          score += 1;

          if (score % 5 == 0 && asteroidLimit < 6) {
            oldLimit = asteroidLimit;
            asteroidLimit += 1;
          }
        }
      }
    }
  }

  draw() {
    drawBlock(this.xPos, this.yPos, yellow, this.size);
  }
}

class Asteroid {
  constructor(x, y) {
    this.xPos = x;
    this.yPos = y;
    this.yVel = 1;
    this.width = 4;
    this.height = 2;
    this.color = black;
    this.active = true;
  }

  reset() {
    this.xPos = 2 * Math.round(Math.random() * 31);
    this.yPos = -1;
    this.active = true;
  }

  update() {
    if (frame % 2 != 0) {
      return;
    }

    // ground collision
    if (this.yPos + this.yVel > 62) {
      player.health -= 1;
      if (player.health == 0) {
        player.diedAt = frame;
      }
      this.active = false;
    }

    // player collision
    const diffX = Math.abs(this.xPos - player.xPos);

    if (this.yPos + this.yVel == player.yPos && diffX <= 3) {
      player.health -= 1;
      if (player.health == 0) {
        player.diedAt = frame;
      }
      this.active = false;
    }

    this.yPos += this.yVel;
  }

  draw() {
    if (this.active) {
      drawRectangle(this.xPos, this.yPos, this.color, this.width, this.height);
    }
  }
}

